(function (global, factory, plugins) {
    global.html2pdf = factory();
})(this, function () {
    var defSetting = {
        element: document.body, //如果需要分页，可以传递一个数组，每个元素为一页
        orient: "p", //纸张方向，l(landscape):横向（默认），p(portrait)纵向
        unit: "mm", //单位，会影响之后的设置
        width: 210, //宽
        height: 297, //长
        paddingLeft: 5, //左边距
        paddingTop: 5, //右边距
        paddingRight: 5, //顶部边距
        paddingBottom: 5, //底部边距
        filename: "download.pdf", //文件名
        onDownload: null,//下载完成时执行
        logging: false    //是否打印日志
    }

    var html2pdf = function (setting) {
        var args = {};
        for (var name in defSetting) {
            if (typeof defSetting[name] !== 'boolean')
                args[name] = setting[name] || defSetting[name];
            else
                args[name] = setting[name] == null ? defSetting[name] : setting[name];
        }
        if ((args.orient.toLowerCase().charAt(0) == 'l' && (args.width < args.height))
            || (args.orient.toLowerCase().charAt(0) == 'p' && (args.width > args.height))) {
            var temp = args.width;
            args.width = args.height;
            args.height = temp;
        }
        var elements;
        if(Object.prototype.toString.apply(setting.element)==="[object Array]"){
            elements=setting.element;
        }else{
            elements=[setting.element];
        }
        var initCount=0;
        var doc = new jsPDF(args.orient, args.unit, [args.width, args.height]);
        var paperWidth = args.width - args.paddingLeft - args.paddingRight;
        for(var i=0;i<elements.length;i++){
            html2canvas(elements[i], {
                useCORS: true,
                logging: args.logging
            }).then(function (canvas) {
                var imgData = canvas.toDataURL();
                var width = canvas.width;
                var height = canvas.height;
                doc.addImage(
                    imgData,
                    "png",
                    args.paddingLeft,
                    args.paddingTop,
                    paperWidth,
                    paperWidth / width * height
                );
                initCount++;
                if(initCount===elements.length){
                    doc.save(args.filename);
                    if (typeof args.onDownload == "function") {
                        args.onDownload.apply(null, [doc]);
                    }
                }else{
                    doc.addPage();
                }
            });
        }

    };
    return html2pdf;
});